'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term7' => 'Melao ye e bušwa ke melao ya naga ya California, U.S.A., go sa akaretšwe go lwantšhana ga yona le molao wa kabo. Ge eba karolo efe goba efe ya melao ye e sa šome goba e ka se gapeletšwe, dikarolo tšeo di šetšego di tla šala di šoma ka mo go feletšego. Tabeng yeo go yona go bago le go thulana magareng ga kgatišo yeo e fetoletšwego le kgatišo ya leleme la Seisemane, go tla laola kgatišo ya leleme la Seisemane.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'Ditirelo di newa go ya &#34;kamoo di lego ka gona.&#34; &amp;vendorShortName;, batsenya-letsogo ba yona, badilaesense, le baphatlalatši ba ganetša dikaranti ka moka, go sa šetšwe gore di boletšwe goba di šišintšwe, go akaretšwa ka ntle le tekanyetšo, dikaranti tšeo ditirelo di rekwago le tšona e bile di swanela morero wa gago o itšego.  O rwala maikarabelo a kotsi ka moka a go kgetha ditirelo bakeng sa merero ya gago gotee le boleng le tsela ya go šoma ga ditirelo. Dikahlolo tše dingwe ga di dumelele go se akaretšwe goba tekanyetšo ya dikaranti tšeo di šišintšwego, ka gona kganetšo ye e ka no se šome go wena.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'Ka ntle le ge go nyakwa ke molao, &amp;vendorShortName;, batsenya-letsogo ba yona, badilaesense, le baphatlalatši ba ka se ikarabele ka tshenyo ya go lebanya, e kgethegilego, e kopanego le maemo, ditlamorago, kotlo, goba tša mohlala tšeo di tšwelelago go goba ka go tswalana ka tsela efe goba efe le tirišo ya &amp;brandShortName; le ditirelo.  Maikarabelo ao a kgobokeditšwego ka tlase ga melao ye a ka se fete $500 (ditolara tše makgolo a mahlano). Dikahlolo tše dingwe ga di dumelele go se akaretšwe goba tekanyetšo ya ditshenyo tše itšego, ka gona go se akaretšwe mo le tekanyetšo di ka no se šome go wena.',
